input:
agent AdvancedAssistant {
    name: "Advanced AI Assistant"
    description: "A fully-featured AI assistant"
    version: "3.0.0"
    author: "Test Team"

    capabilities [
        natural_language_processing,
        code_generation(language("python"), style("pep8")),
        data_analysis
    ]

    parameters {
        model: "gpt-4"
        temperature: 0.7
        max_tokens: 2000
        api_key: required
    }

    rules {
        on_error: retry(3)
        rate_limit: 100/hour
        timeout: 60
    }
}
